        })
    }*/

    return(
    <React.Fragment>

        <p>Table</p>
        <table>
            <thead>
                <tr>{renderHeaders()}</tr>
            </thead>
            <tbody>
                <tr>{renderValues()}</tr>
            </tbody>                  
        </table>
    </React.Fragment> 
    )
}

export default MainTable;
